import './App.css';
import React from 'react';
import {StyleSheet, View} from 'react-native';
// ------------------[ Global variables ]------------------ //


// ------------------[ Main method ]------------------ //

const Flex = () => {

  const [pokemon, setPokemon] = React.useState(GetPokemon("ditto"))

  return (
  <View style={styles.index}>
    <PokeInfo pokemon={pokemon}/>
    <PokeList/>
  </View>
)};

// ------------------[ Info side ]------------------ //

function PokeInfo(pokemon) {
  return (
    <View style={[
      styles.container, 
      {
        flex: 2,
        marginRight: 10,
        flexDirection: 'column'
      }
      ]}>
        <PokeImage pokemon={pokemon}/>
        <PokeDescription/>
    </View>)
}

// ------------------[ PokeDesc Components ]------------------ //

function PokeImage(pokemon) {
  return <View style={[{flex: 1, backgroundColor: 'yellow', margin: 20}]}>
    <img src={pokemon["sprites"]["front_default"]}/>
  </View>
}

function PokeDescription(pokemon) {
  return <View style={[{flex: 2, backgroundColor: 'green', margin: 20}]} >

  </View>
}

// ------------------[ List side ]------------------ //

const PokeList = () => {
  const [page, setPage] = React.useState(0)

  pokemons = ShowPokemons(page.toString)

  return (
    <View style={[
      styles.container, 
      {
        flex: 7 
      }
    ]}>
      <View style={[{flexDirection: 'row', flex: 1}]}>
        <PokeCard pokemon={pokemons["results"]["0"]}/>
        <PokeCard pokemon={pokemons["results"]["1"]}/>
        <PokeCard pokemon={pokemons["results"]["2"]}/>
        <PokeCard pokemon={pokemons["results"]["3"]}/>
        <PokeCard pokemon={pokemons["results"]["4"]}/>
      </View>
      <View style={[{flexDirection: 'row', flex: 1}]}>
        <PokeCard pokemon={pokemons["results"]["5"]}/>
        <PokeCard pokemon={pokemons["results"]["6"]}/>
        <PokeCard pokemon={pokemons["results"]["7"]}/>
        <PokeCard pokemon={pokemons["results"]["8"]}/>
        <PokeCard pokemon={pokemons["results"]["9"]}/>
      </View>
      <View style={[{flexDirection: 'row', flex: 1}]}>
        <PokeCard pokemon={pokemons["results"]["10"]}/>
        <PokeCard pokemon={pokemons["results"]["11"]}/>
        <PokeCard pokemon={pokemons["results"]["12"]}/>
        <PokeCard pokemon={pokemons["results"]["13"]}/>
        <PokeCard pokemon={pokemons["results"]["14"]}/>
      </View>
    </View>
  )
}

// ------------------[ List Components ]------------------ //

function PokeCard(pokemon) {
  return (
    <View style={[styles.container, {flex: 1, borderTopWidth: 1, borderColor: 'black', backgroundColor: 'white', margin: 10, alignItems: 'center'}]}>
      <img src={pokemon["sprites"]["front_default"]}/>
      <p>{pokemon["name"]} tempTest</p>
    </View>
  )
}

// ------------------[ Async API reads ]------------------ //

async function GetPokemon(pokemon) {
  try {
      await fetch("https://pokeapi.co/api/v2/pokemon/" + pokemon)
          .then(response => {
              if (response.ok) return response.json();
              else new Error("Pokemon or network not found.");
          })
  }   
  catch {
      return null
  }
}

async function ShowPokemons(page) {

  offset = page*15

  try {
      await fetch(`pokemon?limit=15&offset=${offset}`)
          .then(response => {
              if (response.ok) return response.json();
              else new Error("Pokemon or network not found.");
          })
  }   
  catch {
      return null
  }
}

// ------------------[ Style Sheets ]------------------ //

const styles = StyleSheet.create({
  index: {
    flex: 1,
    flexDirection: 'row',
    height: 700,
    padding: 20
  },
  container: {
    borderRadius: 10,
    shadowColor: 'black',
    shadowRadius: 4,
    backgroundColor: '#F0F8FF'
  },
  image: {
    margin: 10
  }
})

export default Flex;
